import React from "react";
import Navbar from "./Navbar";
import { useState, useEffect } from "react";
import axios from "axios";

function Diet() {
  const [recipe, setRecipe] = useState([]);
  const options = {
    method: "GET",
    url: "https://low-carb-recipes.p.rapidapi.com/search",
    params: {
      name: "cake",
      ingredients: "egg",
      maxPrepareTime: "30",
      maxCookTime: "20",
      maxCalories: "500",
      maxSugar: "3",
      maxAddedSugar: "0",
    },
    headers: {
      "X-RapidAPI-Key": "f8c12d704dmsh9d800336105051fp1ebb98jsn3cb33ae80541",
      "X-RapidAPI-Host": "low-carb-recipes.p.rapidapi.com",
    },
  };

  useEffect(() => {
    axios
      .request(options)
      .then(function (response) {
        setRecipe(response.data);
      })
      .catch(function (error) {
        console.error(error);
      });
  }, []);

  recipe.forEach((data) => {
    console.log(data);
  });
  return (
    <div className="min-h-[100vh]">
      <Navbar />

      {recipe.map((recipe) => {
        return (
          <div>
            <h1 className="text-xl text-white">{recipe.name}</h1>
            <p className="text-gray-400">{recipe.description}</p>

            <img src="" alt="" />
            {recipe.steps.map((res) => {
              return <li className="text-gray-400">{res}</li>;
            })}

            {recipe.nutrientations.map((res) => {
              <h1>dd</h1>;
            })}
          </div>
        );
      })}
    </div>
  );
}

export default Diet;
